import React from "react";
import AppLayout from "../components/AppLayout";
import Head from "next/head";

const Signup = () => (
  <>
    <Head>
      <meta charSet="utf-8" />
      <title>회원가입 | NodeBird</title>
    </Head>
    <AppLayout>
      <div>회원가입</div>
    </AppLayout>
  </>
);

export default Signup;
